import React from "react";
import Header from "../components/Header";
import { HeroButton } from "../components/Button";

export default function Homepage() {
  return (
    <>
      <Header />
      <main className="">
        <section className="min-h-screen bg-gray-600 pt-10">
          <div className="relative flex flex-col">
            <h2 className="relative top-96 text-center text-4xl md:text-5xl md:w-4/12 m-auto font-extrabold text-white">
              Welcome to
            </h2>
            <h2 className="relative top-96 text-center text-4xl md:text-5xl md:w-4/12 m-auto font-extrabold text-white">
              Global Influence Church!
            </h2>
            {/* <HeroButton title="Worship with us" /> */}
            <button className="py-3 px-5 absolute rounded-md bg-white">
              Test
            </button>
          </div>
        </section>
      </main>
    </>
  );
}
